import styled from 'styled-components';

export const Form = styled.form`
  width: 3000px;
  margin: 10px;
`;

export const Input = styled.input`
  padding: 8px;
  margin: 8px 0;
  border: 1px solid #ccc;
`;

export const Button = styled.button`
  background-color: #007bff;
  color: #fff;
  padding: 10px 20px;
  border: none;
`;
